        self._my_number = None
        self._column = None
        self._row = None
        self._eps = None
        self._sight = 9
        self._nn = NeuralNetwork(ckpt)
        self.step:int = None
        self.explored = []
        self.prev_action = None
        self.state_space = self._sight * self._sight + 4 # Quad score sum 
        
        
        

